import {createMuiTheme} from '@material-ui/core/styles';


const theme = createMuiTheme({
    typography: {
        useNextVariants: true, 
        fontFamily: 'Roboto, Bebas Neue , Arial',
    },
    palette: {
        primary: {
            light: '#9e9e9e',
            main: '#212121',
            dark: '#006db3',
            contrastText: '#fafafa',
        },
        secondary: {
            light: '#9e9e9e',
            main: '#9e9e9e',
            dark: '#006db3',
            contrastText: '#fafafa',
        },
        contrastText: {
            main: '#9e9e9e'
        }
    },
    shape: {
        borderRadius: 10
    },
    
});

export default theme;
